document.addEventListener("DOMContentLoaded", function() {
    // Create a div element
    var blueSection = document.createElement("div");

    // Set styles for the blue section
    blueSection.style.backgroundColor = "blue";

    // Create a title element
    var title = document.createElement("h1");
    title.textContent = "Test";
    title.style.color = "white";
    title.style.textAlign = "center";
    title.style.paddingTop = "80px"; // Adjust vertical padding to center title vertically

    // Append the title to the blue section
    blueSection.appendChild(title);

    // Append the blue section to the body
    document.body.appendChild(blueSection);
});
